import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import BackImage from './assets/airplane-2748431_960_720.png';
import Cari from './Cari';
import hasilPencarian from "./HasilPencarian";
import { ImageBackground } from "react-native";

const stack = createStackNavigator();

function App(){
  return( 
    <NavigationContainer>
      <stack.Navigator>
        <stack.Screen
          name="Cari"
          component={Cari}
          options={{
            header: () => null
          }}
        />
        <stack.Screen
          name="Hasil Pencarian"
          component={hasilPencarian}
        />
      </stack.Navigator>
    </NavigationContainer>
  )
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 24,
    alignItems: 'center'
  },

  namaapk: {
    padding: 20,
    fontSize: 30,
    textAlign: 'center',
    fontWeight: "bold",
    color: "white"
  },

  bgbox: {
    width: 300,
    marginTop: 50,
    paddingVertical: 20,
    paddingHorizontal: 23,
    borderRadius: 10,
    shadowOpacity: 0.5,
    shadowRadius: 15.5,
    backgroundColor: "white",
    alignItems: 'center'

  },
  teksDiBox: {
    color: "black",
    alignSelf: 'flex-start',
    fontSize: 15,
    fontWeight: "bold",
    paddingVertical: 5,
    },

  inputteks: {
    height: 40,
    width: 260,
    borderWidth: 1,
    borderRadius: 5,
    borderColor: '#555',
    marginBottom: 5, 
    fontSize: 10,
    fontWeight: 'bold',
  },

  tombol:{
    height: 35,
    width: 260,
    borderRadius: 5,
    backgroundColor: "orange", 
    paddingVertical: 7,
    marginTop: 20
  },

  tekstombol: {
    fontsize: 15,
    color: '#fff',
    fontWeight: '500',
    textAlign: 'center'
  },

  namanim: {
    padding: '200',
    fontSize: 15,
    textAlign: 'center',
    fontWeight: "bold",
    color: "black",
  },
});

export default App;
